Memoization is an optimization technique used primarily to speed up computer programs by storing the results of expensive function calls and reusing them when the same inputs occur again.

Here is a Python function to calculate the Fibonacci sequence recursively with memoization:

```python
def fibonacci(n, memo = {}):
    if n <= 0:
        return 0
    elif n == 1:
        return 1
    elif n not in memo:
        memo[n] = fibonacci(n-1, memo) + fibonacci(n-2, memo)
    return memo[n]
```

In this function, `memo` is a dictionary that stores previously calculated Fibonacci numbers. If the Fibonacci number for a particular `n` has already been calculated, it is returned from the dictionary. If not, it is calculated and stored in the dictionary before being returned. This greatly speeds up the function for larger values of `n`, as it avoids the exponential time complexity of the naive recursive implementation.
